const App = () => {
    const searchMovies = async (title) => {
        const response = await fetch(`${API_URL}&s=${title}`);
        const data= await response.json();
        console.log(data.Search);
    }
    useEffect(() => {
        searchMovies('joker')
    },[])
    return (
        <div className="app">
            <h1>Movie Land</h1>
            <div className="search">
                <input placeholder="Search For Movies" value=""></input>
            </div>
        </div>
    );
}

export default App;
